export default (function(a,b,c,d,e,f,g,h){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:f,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:c,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:c,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:c,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:f,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:g,pageSize:25,pageCount:g,total:5}}},sWTiAjloBh:{data:{id:2753,attributes:{imdbId:"tt1655389",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BYjM4Y2IxOWUtYWIwMy00YWEwLTllMjQtN2ZiOGU1OTUyODNmXkEyXkFqcGdeQXVyMTE3MjI3MTc2._V1_SX300.jpg",type:c,ratings:[],item_lang:{data:{id:3420,attributes:{title:d,plot:"A fictionalized chronicle of the inner life of Marilyn Monroe.",slug:"blonde"}}},books:{data:[{id:13095,attributes:{title:d,description:"In this ambitious book, Joyce Carol Oates boldly reimagines the inner, poetic, and spiritual life of Norma Jeane Baker—the child, the woman, the fated celebrity and idolized blonde the world came to know as Marilyn Monroe. In a voice startling, intimate, and rich, Norma Jeane tells her own story, that of an emblematic American artist—intensely conflicted and driven—who has lost her way. A powerful portrait of Hollywood’s myth and an extraordinary woman’s heartbreaking reality, Blonde is a sweeping epic that pays tribute to the elusive magic and devastation behind the creation of the great twentieth-century American star.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=5w2JDQAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:true,published:"2017-02-14",publisher:"HarperCollins",subtitle:"A Novel"}},{id:13096,attributes:{title:d,description:"« Alors, en début de soirée, ce 3 août 1962, vint la Mort, index sur la sonnette du 12305 Fifth Helena Drive. La Mort qui essuyait la sueur de son front avec sa casquette de base-ball. La Mort qui mastiquait vite, impatiente, un chewing-gum. Pas un bruit à l'intérieur. La Mort ne peut pas le laisser sur le pas de la porte, ce foutu paquet, il lui faut une signature. Elle n'entend que les vibrations ronronnantes de l'air conditionné. Ou bien... est-ce qu'elle entend une radio là ? La maison est de type espagnol, c'est une « hacienda » de plain-pied; murs en fausses briques, toiture en tuiles orange luisantes, fenètres aux stores tirés. On la croirait presque recouverte d'une poussière grise. Compacte et miniature comme une maison de poupée, rien de grandiose pour Brentwood. La Mort sonna à deux reprises, appuya fort la seconde. Cette fois, on ouvrit la porte. De la main de la Mort, j'acceptais ce cadeau. Je savais ce que c'était, je crois. Et de la part de qui c'était. En voyant le nom et l'adresse, j'ai ri et j'ai signé sans hésiter. »",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=9CtvHAAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:e,published:"2002-01-01",publisher:"LGF\u002FLe Livre de Poche",subtitle:h}},{id:13097,attributes:{title:"Blonde 20th Anniversary Edition",description:"The 20th anniversary edition of the National Book Award finalist and national bestseller exploring the life and legend of Marilyn Monroe In one of her most ambitious works, Joyce Carol Oates boldly reimagines the inner, poetic, and spiritual life of Norma Jeane Baker--the child, the woman, the fated celebrity, and idolized blonde the world came to know as Marilyn Monroe. In a voice startlingly intimate and rich, Norma Jeane tells her own story of an emblematic American artist--intensely conflicted and driven--who had lost her way. A powerful portrait of Hollywood's myth and an extraordinary woman's heartbreaking reality, Blonde is a sweeping epic that pays tribute to the elusive magic and devastation behind the creation of the great 20th-century American star.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=zV2sxwEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:e,published:"2020-04-14",publisher:"Ecco",subtitle:b}},{id:13098,attributes:{title:"Blonde (Spanish Edition)",description:b,thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=l8lzzgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:e,published:"2021-09-21",publisher:"Alfaguara",subtitle:b}},{id:13099,attributes:{title:d,description:"Blonde ne ressemble à aucun livre de Joyce Carol Oates. Avec cette oeuvre monumentale et baroque, qu'elle compose à partir des fantasmes que lui inspire Marilyn Monroe, l'écrivain a marqué de son empreinte un genre inédit : la \" bio-fiction \". Construite en cinq actes, cette tragédie est écrite sur deux modes : l'un, narratif et réaliste, l'autre surréaliste, composé de visions et d'hallucinations. Un peu comme si la folie d'une Marilyn starifiée venait interrompre les voix de différents personnages tentant de raconter son histoire. Au sein de ce choeur, on entend le souffle gracile et timide de Norma Jeane, l'enfant blessée et perdue que Marilyn a dû être, obsédée par le pouvoir de destruction et la fragilité de sa mère.",thumbnail:b,authors:[a],firstBook:e,published:"2010-01-01",publisher:b,subtitle:h}}]}}},meta:{}}},prerenderedAt:1682568321716}}("Joyce Carol Oates","","movie","Blonde",null,"series",1,"roman"))